import React from "react";
import {
    Typography,
    Button,
    Container,
    Grid
} from "@material-ui/core";

class FileItem extends React.Component {
    render() {
        return (
            <div style = {{backgroundColor: "red", width: "20%"}}>
                <span style = {{display: "flex"}}>
                    <Grid item>
                        <Typography>Name</Typography>
                    </Grid>
                </span>

            </div>
        )
    }
}

export default FileItem;
